import React, { Component, Fragment, useEffect } from "react";
import styled from "styled-components";
import { SURVEY_DATA } from "../../config";

const Survey = () => {
  useEffect();

  return (
    <Fragment>
      <WrapSurvey>
        <Header>
          <div>핵심 능력 테스트</div>
          <span>1/7</span>
        </Header>
      </WrapSurvey>
    </Fragment>
  );
};

export default Survey;

const WrapSurvey = styled.section``;
